import React, { useRef, useState } from 'react';
import html2canvas from 'html2canvas';
import { write } from 'clipboard-polyfill';
import "../../assets/styles/secondpage.scss";
import { ToastContainer, toast } from 'react-toastify';

const EightyPage = () => {
    const screenshotRef = useRef(null);

    const [data, setData] = useState({
        amount: "218.05 USDT",
    });

    const [imageDimension, setImageDimension] = useState("167");

    const onChangeHandler = (e) => {
        setData({ ...data, [e.target.name]: e.target.value });
    }

    const notify = (message) => toast.success(message, {
        containerId: 'success-toast',
        style: {
            background: 'black',
            color: 'white',
        },
    });


    const takeScreenshot = async () => {
        try {
            const canvas = await html2canvas(screenshotRef.current);
            const dataURL = canvas.toDataURL('image/png');

            const img = new Image();
            img.src = dataURL;

            img.onload = () => {
                const canvas = document.createElement("canvas");
                canvas.width = img.width;
                canvas.height = img.height;

                const context = canvas.getContext("2d");
                context.drawImage(img, 0, 0);

                // Convert canvas to blob
                canvas.toBlob((blob) => {
                    const clipboardItem = new ClipboardItem({ [blob.type]: blob });

                    // Use the clipboard-polyfill to copy the item
                    write([clipboardItem]).then(() => {
                        notify("Copied to clipboard");
                    }).catch((error) => {
                        console.error("Error copying image:", error);
                    });
                }, img.type);
            };
        } catch (error) {
            console.error('Error taking screenshot:', error);
        }
    };

    return (
        <>
            <div className="billing_childs">
                <ToastContainer autoClose={1000} />
                <div className="app-heading">
                    <h3>PREVIEW - <span>Mobile 80</span></h3>
                    <div class="slidecontainer">
                        <button onClick={() => takeScreenshot()}>Screenshot <i className="fa fa-copy"></i></button>
                        <span>{imageDimension + "%"}</span>
                        <input
                            type="range"
                            min="1"
                            max="500"
                            className="slider"
                            name="imageDimension"
                            value={imageDimension}
                            onChange={(e) => setImageDimension(e.target.value)}
                        />
                    </div>
                </div>
                <div className="mobile-view-wrapper">
                    <div className="artboard roboto">
                        <foreignObject ref={screenshotRef}>
                            <svg
                                xmlns="http://www.w3.org/2000/svg"
                                xmlnsXlink="http://www.w3.org/1999/xlink"
                                width={imageDimension + "%"}
                                viewBox="0 0 3207 1347"
                            >
                                <defs>
                                    <pattern
                                        id="pattern"
                                        width="100%"
                                        height="100%"
                                        preserveAspectRatio="none"
                                        viewBox="0 0 657 228"
                                    >
                                        <image
                                            width="657"
                                            height="228"
                                            xlinkHref="data:image/png;base64,"
                                        ></image>
                                    </pattern>
                                </defs>
                                <g data-name="Group 347" transform="translate(-222 -3523)">
                                    <g data-name="Group 346">
                                        <image
                                            width="3207"
                                            height="1347"
                                            transform="translate(222 3523)"
                                            xlinkHref="data:image/jpeg;base64,"
                                        ></image>
                                        <rect
                                            width="2950"
                                            height="839"
                                            fill="#fff"
                                            data-name="Rectangle 439"
                                            rx="103"
                                            transform="translate(351 3803)"
                                        ></rect>
                                        <rect
                                            width="248"
                                            height="249"
                                            fill="#15192a"
                                            data-name="Rectangle 440"
                                            rx="55"
                                            transform="translate(486 4103)"
                                        ></rect>
                                        <path
                                            fill="url(#pattern)"
                                            d="M0 0H214V74H0z"
                                            data-name="Image 97"
                                            transform="translate(503 4191)"
                                        ></path>
                                        <text
                                            fill="#262626"
                                            data-name="Deposit Confirmation in Progress"
                                            fontFamily="Roboto-Medium, Roboto"
                                            fontSize="118"
                                            fontWeight="600"
                                            transform="translate(849 4128)"
                                        >
                                            <tspan x="0" y="0">
                                                Deposit Confirmation in Progress
                                            </tspan>
                                        </text>
                                        <text
                                            fill="#262626"
                                            data-name="Your deposit of 218.05 USDT is awaiting"
                                            fontFamily="Roboto-Regular, Roboto"
                                            fontSize="115"
                                            transform="translate(849 4261)"
                                        >
                                            <tspan x="0" y="0">
                                                Your deposit of {data.amount} is awaiting
                                            </tspan>
                                        </text>
                                        <text
                                            fill="#262626"
                                            data-name="confirmation. Click to view the details &gt;&gt;"
                                            fontFamily="Roboto-Regular, Roboto"
                                            fontSize="115"
                                            transform="translate(849 4394)"
                                        >
                                            <tspan x="0" y="0">
                                                confirmation. Click to view the details &gt;&gt;
                                            </tspan>
                                        </text>
                                        <text
                                            fill="#262626"
                                            fontFamily="Roboto-Regular, Roboto"
                                            fontSize="94"
                                            transform="translate(2969 4120)"
                                        >
                                            <tspan x="0" y="0">
                                                acum
                                            </tspan>
                                        </text>
                                    </g>
                                </g>
                            </svg>
                        </foreignObject>
                    </div>
                </div>
            </div>
            <div className="billing_childs">
                <div className="app-heading">
                    <h3>CONTROLS</h3>
                </div>
                <div className="global_form_wrapper">
                    <div className="global_form_inner">
                        <label>Amount</label>
                        <input
                            type="text"
                            value={data.amount}
                            name="amount"
                            onChange={(e) => onChangeHandler(e)}
                        />
                    </div>
                </div>
            </div>
        </>
    )
}

export default EightyPage;